# Helper function to generate a random date within the last 60 days
def get_random_date(days=60):
    now = datetime.datetime.now()
    random_days = random.randint(0, days)
    past_date = now - datetime.timedelta(days=random_days)
    return past_date

# Helper function to create article with common fields
def create_article(name, slug, content, excerpt, author_id, category_id, is_spotlight=False, is_popular=False):
    created_at = get_random_date()
    
    return {
        "_id": ObjectId(),
        "name": name,
        "slug": slug,
        "content": content,
        "excerpt": excerpt,
        "image": article_photo_1_base64,
        "read_time": random.randint(5, 25),  # 5-25 minutes read time
        "category_id": category_id,
        "author_id": author_id,
        "created_at": created_at,
        "updated_at": created_at,
        "views": random.randint(500, 1500) if is_popular else random.randint(0, 200),
        "likes": random.randint(50, 150) if is_popular else random.randint(0, 30),
        "comments": [],
        "status": "published",
        "is_spotlight": is_spotlight,
        "is_popular": is_popular
    }

